import React from "react";
import "./App.css";

function App() {
  return (
    <div className="app-root">
      <header className="app-header">
        <h1>Cola Trails</h1>
      </header>
      <main style={{
        paddingLeft: "20%"
      }}>
      </main>
    </div>
  );
}

export default App;
